import React, { Component, useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import axios from "axios";

const UserProfiles = () => {
  const fetchUsers = () => {
    axios.get("http://localhost:8080/all").then((res) => {
      console.log(res);
      const data = res.data;
    });
  };
  useEffect(() => {
    fetchUsers();
  }, []);

  return <h1>hello</h1>
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <UserProfiles/>
      </div>
    );
  }
}
export default App;
